import React from "react";
import { useEffect, useState } from "react";
import { vendiaClient } from "./VendiaClient";

const { client } = vendiaClient();


export const DevicePage = () => {

    

    
    const filterTestList = async (Device) =>
    {
        const testList = client.entities.test.list();
        const temp = testList.filter(testList => testList.Device.includes('Device1'))

    }

    /*
    {names.filter(name => name.includes('J')).map(filteredName => (
        <li>
          {filteredName}
        </li>
      ))}
    */
    return(
        
        <div className="DevicePage">
            <h1> Device 1 </h1>

            <div>
                {temp?.map((item, index) => (
                    <li key={index}>   
                    {item.Device}
                    </li>
                ))}
            </div>

        </div>

    )
}
